import React from 'react';
import './App.css';

import Menu from './Menu/Menu';
import Hero from './Hero/Hero';
import Homepage from './Homepage/Homepage';
import Footer from './Footer/Footer';

function App() {
  return (
    <div className="App">
      <Menu/>
      <Hero/>
      <Homepage/>
      <Footer/>
    </div>
  );
}

export default App;
